import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function Square(props){
  return(
    <button className="square" onClick = {props.onClick}>
      {props.value}
    </button>
  );
}

class Board extends React.Component{
  handleClick(){
    this.value = value
  }
  generateSquare(value){
    return (<Square
      value = {this.value}
      onClick = {handleClick}
    />);
  }
  render(){
    return(
      <div>
        <div className="board-row">
          {this.generateSquare(0)}
          {this.generateSquare(0)}
          {this.generateSquare(0)}
        </div>
        <div className="board-row">
          {this.generateSquare(0)}
          {this.generateSquare(0)}
          {this.generateSquare(0)}
        </div>
        <div className="board-row">
          {this.generateSquare(0)}
          {this.generateSquare(0)}
          {this.generateSquare(0)}
      </div>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Board/>
    </div>
  );
}

export default App;
